    AngleIsBetweenAngles(a, b) {
      const firstAngle = C3.toRadians(a)
      const secondAngle = C3.toRadians(b)
      const angle = this._inst.GetWorldInfo().GetAngle()
      return angle >= firstAngle && angle <= secondAngle;
   },

   /////////////// ORIGIN TRANSFORM

