"use strict";

{
	C3.Plugins.StraniAnelli_HTMLElement.Acts =
	{

		/////////////// APPEARANCE

		AppearanceToggleVisible() { // Toggle visible: toggle whether the object is hidden or shown
			this.html.isVisible = !this.html.isVisible;
			this.SetVisible(this.html.isVisible);
		},

		AppearanceSetVisible(visible) { // Set whether the object is hidden or shown
			this.html.isVisible = !!visible; // converte 0 a false, 1 a true
			this.SetVisible(this.html.isVisible);
		},

		AppearanceSetOpacity(opacity) { // Set how transparent the object appears.
			const o = opacity >= 100 ? 1 : opacity <= 0 ? 0 : opacity / 100;
			this.SetOpacity(o);
		},

		/////////////// TEXT

		TextSetText(string) {	// Set the text of this object.
			this.html.text = string;
			Dom.text(this.el, string);
			this.html.hasText = this.html.text.length > 0 ? true : false;
		},

		TextAppendText(string) {	// Add text to the end of the existing text.
			const testo = Dom.text(this.el);
			this.html.text = testo + string;
			Dom.text(this.el, testo + string);
			this.html.hasText = this.html.text.length > 0 ? true : false;
		},

		/////////////// SIZE & POSITION

		PositionSetPosition(x, y) {	// Set the object's X and Y co-ordinates at the same time.
			let myinstance = this._inst.GetWorldInfo();
			myinstance.SetXY(x,y);
			myinstance.SetBboxChanged();
		},

		PositionSetX(x) {	// Set the object's X co-ordinate.
			let myinstance = this._inst.GetWorldInfo();
			myinstance.SetX(x);
			myinstance.SetBboxChanged();
		},

		PositionSetY(y) {	// Set the object's Y co-ordinate.
			let myinstance = this._inst.GetWorldInfo();
			myinstance.SetY(y);
			myinstance.SetBboxChanged();
		},

		SizeSetSize(w, h) {	// Set the object's width and height at the same time.
			let myinstance = this._inst.GetWorldInfo();
			myinstance.SetSize(w,h);
			myinstance.SetBboxChanged();
		},

		SizeSetWidth(w) {	// Set the object's width.
		let myinstance = this._inst.GetWorldInfo();
		myinstance.SetWidth(w);
		myinstance.SetBboxChanged();
	},

		SizeSetHeight(h) {	// Set the object's height.
			let myinstance = this._inst.GetWorldInfo();
			myinstance.SetHeight(h);
			myinstance.SetBboxChanged();
		},

		/////////////// ANGLE

		AngleSetAngle(a) { // Set the angle the object is oriented at.
      const myinstance = this._inst.GetWorldInfo();
			const angle = C3.toRadians(a)
      myinstance.SetAngle(angle);
			myinstance.SetBboxChanged();
		},

		AngleRotateClockwise(a) { // Rotate the object's angle clockwise by a number of degrees.
			const myinstance = this._inst.GetWorldInfo();
			const angle = myinstance.GetAngle() + C3.toRadians(a);
			myinstance.SetAngle(angle);
			myinstance.SetBboxChanged();
		},

		AngleRotateCounterClockwise(a) { // Rotate the object's angle counter-clockwise by a number of degrees.
			const myinstance = this._inst.GetWorldInfo();
			const angle = myinstance.GetAngle() - C3.toRadians(a);
			myinstance.SetAngle(angle);
			myinstance.SetBboxChanged();
		},

		/////////////// ORIGIN TRANSFORM
		
		OriginTransformSetVerticalOrigin(origin) {
			this.transform.originVertical = origin == 0 ? 'top' : origin == 1 ? 'center' : 'bottom';
			this._inst.GetWorldInfo().SetBboxChanged();
		},

		OriginTransformSetHorizontalOrigin(origin) {
			this.transform.originHorizontal = origin == 0 ? 'left' : origin == 1 ? 'center' : 'right';
			this._inst.GetWorldInfo().SetBboxChanged();
		},

		OriginTransformSetOrigin(vertical, horizontal) {
			this.transform.originVertical = vertical == 0 ? 'top' : vertical == 1 ? 'center' : 'bottom';
			this.transform.originHorizontal = horizontal == 0 ? 'left' : horizontal == 1 ? 'center' : 'right';
			this._inst.GetWorldInfo().SetBboxChanged();
		}

		/* TODO: CSS
					- Add class: add class name to object
					- Remove class: remove object class name.
					- Toggle class:
					- Set tooltip: set the element's tooltip
					- Text selectable: set whether selectable text is true or not
					- Change CSS Style: cambia lo stile CSS (se non esiste lo crea)
					- Clear CSS: clear all CSS Style
		*/
		/* TODO: CSS - From Plugin Settings
					- Preview - Use Preview Color
					- Preview - Use Preview Border
					- Preview - Use Preview Text Settings
					- Auto Font Size
					- Preview - Background Color
					- Preview - Border Width
					- Preview - Border Color
					- Preview - Font
					- Preview - Font Size in points (pt)
					- Preview - Font Color
					- Preview - Font Bold
					- Preview - Font Italic
					- Preview - Font Horizontal Alignment
		*/
		/* TODO: HTML
					- Add HTML code
					- Add Attribute
					- Clear inner HTML
					- Change TAG
					- Change ID
					- Delete Attribute
		*/
		/* TODO: Z ORDER
					- Move to bottom: Place the object at the bottom of its layer.
					- Move to object: Move the object next to another object in the Z order.
					- Move to top: Place the object at the top of its layer.
		*/
	};
}


"use strict";

{
	C3.Plugins.StraniAnelli_HTMLElement.Exps = {

		/////////////// APPEARANCE

		AppearanceGetOpacity() { // Get the object's current opacity, from 0 (transparent) to 100 (opaque).
			const o = Math.round(this._inst.GetWorldInfo().GetOpacity() * 100);
			return o;
		},

		/////////////// TEXT

		TextGetText() { // Get the object's text.
			this.html.text = Dom.text(this.el);
			return this.html.text;
		},

		/////////////// SIZE & POSITION

		PositionGetX() { // Get the object's X co-ordinate, in pixels.
			const x = this._inst.GetWorldInfo().GetX();
			return x;
		},

		PositionGetY() { // Get the object's Y co-ordinate, in pixels.
			const y = this._inst.GetWorldInfo().GetY();
			return y;
		},

		SizeGetWidth () { // Get the object's width, in pixels.
			const w = this._inst.GetWorldInfo().GetWidth();
			return w;
		},

		SizeGetHeight () { // Get the object's height, in pixels.
			const h = this._inst.GetWorldInfo().GetHeight();
			return h;
		},

		/////////////// ANGLE

		AngleGetAngle () { // Get the object's current angle, in degrees.
			const a = this._inst.GetWorldInfo().GetAngle();
			return C3.toDegrees(a);
		},

		AngleGetAngleRAD () { // Get the object's current angle, in radians.
			const a = this._inst.GetWorldInfo().GetAngle();
			return a;
		},

		/////////////// ORIGIN TRANSFORM

		OriginTransformGetVertical() {
			return this.transform.originVertical;
		},

		OriginTransformGetHorizontal() {
			return this.transform.originHorizontal;
		},

		/////////////// CSS

		CSSGetClassesAsStringList() { // restituisce l'elenco delle class assegnate all'oggetto
			// è una stringa in cui ogni classe è separata da una virgola
			return Dom.getClass(this.el).toString();
		},

		CSSGetClassAsBoolean(classDaVerificare) { // se la classe esiste restituisce 1 altrimenti 0
			return Dom.hasClass(this.el, classDaVerificare) ? 1 : 0;
		},

		CSSgetCSS(style) {
			return Dom.css(this.el, style);
		},

		/////////////// HMTL

		HTMLgetID(){
			return Dom.attribute(this.el, 'id');
		},

		HTMLgetUID() {
			return Dom.attribute(this.el, 'sa-uid');
		},

		HTMLgetTAG() {
			return this.el.tagName;
		},

		HTMLgetAttribute(attr) {
			return Dom.attribute(this.el, attr);
		},

		HTMLgetVALUE() {
		 	return Dom.attribute(this.el, 'value');
		},

		HTMLgetValueRadio(radioName) {
			// http://jsfiddle.net/Xxxd3/610/
			const radios = document.querySelectorAll(`[sa-uid="${this.html.uid}"] [name="${radioName}"]`);
			// const radios = document.getElementsByName(radioName);
				for (let i = 0, length = radios.length; i < length; i++) {
				    if (radios[i].checked) {
				        return radios[i].value;
				        // only one radio can be logically checked, don't check the rest
				        break;
				    }
				}
		},
		HTMLgetCheckedStatus() {
			const bool = this.el.checked;
			return bool ? 1 : 0;
		},

		/////////////// EVENT
		GetLastEventAsJSON() {
				return this._SerializeEvent(this.lastEvent);
		},
		GetLastEventType() {
				return this.lastEvent["type"];
		},
		GetLastEventProperty(property) {
				if (property == "eventName") return this.lastEvent.toString();
				return this.lastEvent[property];
		}
	};
}


